import React from 'react';
import ReactDOM from 'react-dom';
import './MyApp.css';
import logo from './dccs.png';
import {FiSearch} from 'react-icons/fi';
//import Client from './Client';

class AplicantInfo extends React.Component {
	constructor(props){
		super(props);
	}
	render(){
		return(
		  <div>
		    <p>Name</p>
		    <p>Place of employment</p>
		    <p>Addres</p>
		  </div>
		);
	}
} 

class ApplicantList extends React.Component {
	constructor(props){
		super(props);
		this.state = {names: []}; //array of applicant names  
		//this.client = new Client();
		//this.client.clientResult().then(r =>this.setState({names:r}));
	}

  render(){
	let namesFromServer = ["Almir Omerovic","Ina Golos"];
	this.state.names = namesFromServer;
    return(
      <div id="mainListDiv">
        <p> Showing results in my app </p>
        {this.state.names.map(n => <p>{n}</p>)}
      </div>
    );
  }
}

class SearchBar extends React.Component {
  render(){
    return(
      <div id="searchBar">
        <div id="logoDiv">
          <img id="logoImg"src={logo}/>
        </div>
        <div id="inputDiv">
          <spam><FiSearch/></spam>
          <input id="searchInput" type="text"/>
        </div>
      </div>
    );
  }
}

class MyApp extends React.Component {
  render(){
    return(
      <div id="mainDiv">
        <SearchBar />
        <ApplicantList />
      </div>
    );
  }
}

export default MyApp;
